app.views.dashboard=Backbone.View.extend({initialize:function(){console.log("initializing dashboard view")},events:{},render:function(){$(this.el).html(this.template({name:app.global.tokensCollection.at(0).get("first_name")}));return this},destroy_view:function(){this.undelegateEvents();$(this.el).removeData().unbind();this.remove();Backbone.View.prototype.remove.call(this);app.global.dashboardView=null}})